CREATE PROCEDURE SP_ABREPORTA

	 @EquipamentoIP varchar(max),
	 @UsuarioID varchar(max)
AS
BEGIN
	declare @ServicoID int = 0;
	-- SET NOCOUNT ON added to prevent extra result sets from
	-- interfering with SELECT statements.
	SET NOCOUNT ON;
	insert into ServicoOperacao(EquipamentoIP,Operacao,Parametros,DataCadastro,DataExecucao,IPSolicitante,DataProgramacao) 
						values (@EquipamentoIP,'ABREPORTA','1 1 10',GETDATE(),NULL,'::1',GETDATE());Select @ServicoID = @@IDENTITY

	insert into LOGABREPORTAAPP  (ServicoID,UsuarioID) values (@ServicoID,@UsuarioID) 
END
GO

Create Table LOGABREPORTAAPP (
ID int identity,
UsuarioID Varchar(max),
ServicoID VarChar(max) 

)

